import React from 'react';

const RenderPage = ( props ) => {
  console.log('Render page : ',props);
  const renderData = ( ) => {
    return props.data && Object.values(props.data).map((el,i) => {
          return (
          <tr key={ i }>
            <td>{el.movieName }</td>
            <td>{ el.duration }</td>
            <td>{el.ratings }</td>
          </tr>
          );

    })
  }
    return (
      <div>
        <div className="ui list">
        </div>



        <table className="ui table">
            <thead>
              <tr>
                <th>Movie Name</th>
                <th>Ratings</th>
                <th>Duration</th>
              </tr>
            </thead>
            <tbody>
              { renderData() }
            </tbody>
        </table>
      </div>
    );
}

export default RenderPage;
